import React from "react";
import Row from "react-bootstrap/Row";
import Col from 'react-bootstrap/Col';
import Dichvu1 from "../assets/dich-vu-1.png"
import Dichvu2 from "../assets/dich-vu-2.png"
import Dichvu3 from "../assets/dich-vu-3.png"
import Dichvu4 from "../assets/dich-vu-4.png"
import Dichvu5 from "../assets/dich-vu-5.png"
import Dichvu6 from "../assets/dich-vu-6.png"
import styled from "styled-components";

export default function Dichvu() {
    return (
        <>
            <FormContainer>
                <Row>
                    <Col>
                        <div className="div-list-items">
                            <img src={Dichvu1} alt={Dichvu1} />
                            <h4>DỊCH VỤ BẢO DƯỠNG XE Ô TÔ CHUYÊN NGHIỆP</h4>
                            <p>Các chi tiết máy, động cơ có thể bị hao mòn, yếu hay hư hỏng làm ảnh hưởng đến khả năng vận hành của xe, vì vậy các chủ xe cần bảo dưỡng định kỳ cho xế hộp.</p>
                        </div>
                    </Col>
                    <Col>
                        <div className="div-list-items">
                            <img src={Dichvu2} alt={Dichvu2} />
                            <h4>DỊCH VỤ BẢO DƯỠNG XE Ô TÔ CHUYÊN NGHIỆP</h4>
                            <p>Các chi tiết máy, động cơ có thể bị hao mòn, yếu hay hư hỏng làm ảnh hưởng đến khả năng vận hành của xe, vì vậy các chủ xe cần bảo dưỡng định kỳ cho xế hộp.</p>
                        </div>
                    </Col>
                    <Col>
                        <div className="div-list-items">
                            <img src={Dichvu3} alt={Dichvu3} />
                            <h4>DỊCH VỤ BẢO DƯỠNG XE Ô TÔ CHUYÊN NGHIỆP</h4>
                            <p>Các chi tiết máy, động cơ có thể bị hao mòn, yếu hay hư hỏng làm ảnh hưởng đến khả năng vận hành của xe, vì vậy các chủ xe cần bảo dưỡng định kỳ cho xế hộp.</p>
                        </div>
                    </Col>
                </Row>
                <Row>
                    <Col>
                        <div className="div-list-items">
                            <img src={Dichvu4} alt={Dichvu4} />
                            <h4>DỊCH VỤ BẢO DƯỠNG XE Ô TÔ CHUYÊN NGHIỆP</h4>
                            <p>Các chi tiết máy, động cơ có thể bị hao mòn, yếu hay hư hỏng làm ảnh hưởng đến khả năng vận hành của xe, vì vậy các chủ xe cần bảo dưỡng định kỳ cho xế hộp.</p>
                        </div>
                    </Col>
                    <Col>
                        <div className="div-list-items">
                            <img src={Dichvu5} alt={Dichvu5} />
                            <h4>DỊCH VỤ BẢO DƯỠNG XE Ô TÔ CHUYÊN NGHIỆP</h4>
                            <p>Các chi tiết máy, động cơ có thể bị hao mòn, yếu hay hư hỏng làm ảnh hưởng đến khả năng vận hành của xe, vì vậy các chủ xe cần bảo dưỡng định kỳ cho xế hộp.</p>
                        </div>
                    </Col>
                    <Col>
                        <div className="div-list-items">
                            <img src={Dichvu6} alt={Dichvu6} />
                            <h4>DỊCH VỤ BẢO DƯỠNG XE Ô TÔ CHUYÊN NGHIỆP</h4>
                            <p>Các chi tiết máy, động cơ có thể bị hao mòn, yếu hay hư hỏng làm ảnh hưởng đến khả năng vận hành của xe, vì vậy các chủ xe cần bảo dưỡng định kỳ cho xế hộp.</p>
                        </div>
                    </Col>
                </Row>

            </FormContainer>
        </>
    )
}
const FormContainer = styled.div`
height: 100vh;
width: 100vw;
display: flex;
flex-direction: column;
gap: 1rem;
padding: 5px;
margin-left: 30px;
.div-list-items{
    height: 50vh;
    width: 27.2vw;
    border: solid 0.5px;
}
.div-list-items h4{
    text-align: center;
    margin-top: 5px;
}
.div-list-items p{
    margin-left: 5px;
}
`;
